import express from 'express';
import cors from 'cors';
import bodyParser from 'body-parser';
import bcrypt from 'bcrypt-nodejs';
import knex from 'knex';

const PORT = process.env.HTTP_PORT || 4001;
const app = express();

const db = knex({
	client: 'pg',
	connection: {
		host: '127.0.0.1',
		user: 'liamfudge',
		password: '',
		database: 'chefdb'
	}
});

app.use(bodyParser.json());
app.use(cors());

app.get('/', (req, res) => {
	res.json('this is the server');
})

app.post('/test', (req, res) => {
	res.json(`this is recieving shit ${req.body.email}`);
})


app.post('/register', (req,res) => {
	const { email, password, firstname, surname, phone} = req.body;
	let emailResponse = injectionScan(email);
	let passwordResponse = injectionScan(password);
	let firstnameResponse = injectionScan(firstname);
	let surnameResponse = injectionScan(surname);
	let phoneResponse = injectionScan(phone);
	if(emailResponse === 'success' && passwordResponse === 'success' &&
		firstnameResponse === 'success' && surnameResponse === 'success' &&
		phoneResponse === 'success'){

		let salt = generateSalt(8);
		const hash = bcrypt.hashSync(password + salt);
		db.transaction(trx => {
			trx.insert({
				hash: hash,
				email: email,
				salt: salt
			})
			.into('login')
			.returning('email')
			.then(loginEmail => {
				return trx('users')
					.returning('*')
					.insert({
						firstname: firstname,
						surname: surname,
						email: loginEmail[0],
						phone: phone,
						joined: new Date(),
						chefname: firstname + ' ' + surname
					}).then(user => {
						res.json(user[0]);
					})
			})
			.then(trx.commit).catch(trx.rollback)
		})

		.catch(err => res.status(400).json('error'))
	} else {
		res.json('error');
	}

})



app.post('/signin', (req, res) => {
	const { email, password} = req.body;
	let emailResponse = injectionScan(email);
	let passwordResponse = injectionScan(password);

	let isValid = false;
	if(emailResponse === 'success' && passwordResponse === 'success'){
		db.select('email', 'hash', 'salt').from('login')
			.where({email: email})
			.then(data => {
				isValid = bcrypt.compareSync((password + data[0].salt), data[0].hash);
				if(data.length > 0 && isValid === true){
					return db.select('*').from('users')
						.where('email', '=', email)
						.then(user => {
							res.json(user[0]);
						})
						.catch(err => res.status(400).json('error'));
				} else {
					res.json('error')
				}
			})
			.catch(err => res.status(400).json('error'));
	} else {
		res.json('error');
	}
})

app.post('/updateChef', (req, res) => {
	const { table, id, dbfield, input } = req.body;
	db(table)
		.where('id', id)
		.update({ [dbfield]: input})
		.then(function(result) {
			db.select('*').from(table).where('id', id).then(data => {
				res.json(data[0]);
			})
		})
})

app.post('/bio', (req, res) => {
	const { id, bio, fetchadd } = req.body;
		if(fetchadd === "add"){
			db('bio')
				.where('id', id)
				.update({ bio: bio })
				.then(data => {
					if(data === 0){
						db.insert({id: id, bio: bio}).into('bio').then(data => {
							res.json('success');
						})
					} else {
						res.json('success');
					}
				})
		} else {
			db.select('*').from('bio').where({id: id}).then(data => {
				if(data.length > 0){
					res.json(data[0]);
				} else {
					res.json('failed');
				}

			})
		}
})

app.post('/socials', (req, res) => {
	const { id, link, type, chefid, fetchadd } = req.body;
	db.select('*').from('socials').where({chefid: chefid}).then(data => {
		if(data.length > 0){
			if(fetchadd === "add"){
				if(id === ''){
					db.insert({link: link, type: type, chefid: chefid}).into('socials').then(data => {
						res.json('success');
					})
				} else {
					db.select('*').from('socials').where({id: id}).then(data => {
						if(data.length > 0){
							db('socials').where({id: id}).update({type: type, link: link}).then(data => {
								res.json('success');
							})
						} else {
							db.insert({link: link, type: type, chefid: chefid}).into('socials').then(data => {
								res.json('success');
							})
						}
					})
				}
			} else {
				res.json(data);
			}
		} else {
			if(fetchadd === "add"){
				db.insert({link: link, type: type, chefid: chefid}).into('socials').then(data => {
					res.json('success');
				})
			} else {
				res.json('error');
			}
		}		
	})
})


app.post('/menu', (req, res) => {
	const { id, chefid, fetchadd, updatewhat, input } = req.body;
	if(fetchadd === "add"){
		db.select('*').from('menu').where({chefid: chefid}).then(data => {
			if(data.length > 0){ 
				db('menu').where({chefid: chefid}).update({ [updatewhat]: input, chefid: chefid }).then(data => {
					res.json('success');
				})
			} else {
				db.insert({ [updatewhat]: input, chefid: chefid }).into('menu').then(data => {
					res.json('success');
				})
			}
		})
	}else {
		db.select('*').from('menu').where({chefid: chefid}).then(data => {
			if(data.length > 0){
				res.json(data);
			} else {
				res.json('no data');
			}

		})
	}
}) 


function injectionScan(a) {
	for(let i = 0; i < a.length; i++){
		if(a[i] === ";" || a[i] === "'"){
			return 'failure';
		}
		if(a[i] === "-" && a[i-1] ==="-"){
			return 'failure';
		}
	}
	return 'success';
}

function generateSalt (length) {
	var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789!@#$%^&*()";
	var text = "";
	for (var i = 0; i < length; i++){
		text += possible.charAt(Math.floor(Math.random() * possible.length));
	}
	return text;
}


app.listen(PORT, () => {
	console.log(`Server listening at port ${PORT}.`);
})

